  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Tampa Bay Refuges for the next 15 years. This
  plan outlines the refuges' vision and purpose and describes how Tampa Bay Refuges
  will contribute to the overall mission of the Refuge System. The plan provides an
  introduction to the refuges, an overview of the CCP process, information about plan
  development and the management direction, and strategies for implementation. Key
  planning issues include: wildlife management, habitat management, resource protection,
  visitor services, and refuge administration.\",\n\t\"license_title\": \"License
